import { useState } from "react";
import Button from '@mui/material/Button';
import toast from "react-hot-toast";
import blake from 'blakejs';

const CifradoDjango = () => {
    const [clave, setClave] = useState('')
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [telephone, setTelephone] = useState('');
    const [address, setAddress] = useState('');
    const [targetDeb, setTargerDeb] = useState('');
    const [password, setPassword] = useState('');
    const [outputMessage, setOutputMessage] = useState('');


    return (
        <div style={{ padding: "20px", textAlign: "center" }}>
            <h1>Cifrado de datos en DJANGO</h1>

            <text>Clave para descifrar</text>
            <div style={{ marginBottom: "20px" }}>
                <input
                    type="text"
                    placeholder="Clave"
                    value={clave}
                    onChange={(e) => setClave(e.target.value)}
                    style={{ padding: "10px", width: "300px", fontSize: "16px" }}
                />
            </div>

            <text>Nombre</text>
            <div style={{ marginBottom: "20px" }}>
                <input
                    type="text"
                    placeholder="Nombre"
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                    style={{ padding: "10px", width: "300px", fontSize: "16px" }}
                />
            </div>

            <text>Correo electronico</text>
            <div style={{ marginBottom: "20px" }}>
                <input
                    type="email"
                    placeholder="Correo"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    style={{ padding: "10px", width: "300px", fontSize: "16px" }}
                />
            </div>

            <text>Telefono</text>
            <div style={{ marginBottom: "20px" }}>
                <input
                    type="text"
                    placeholder="Telefono"
                    value={telephone}
                    onChange={(e) => setTelephone(e.target.value)}
                    style={{ padding: "10px", width: "300px", fontSize: "16px" }}
                />
            </div>

            <text>Direccion</text>
            <div style={{ marginBottom: "20px" }}>
                <input
                    type="text"
                    placeholder="Direccion"
                    value={address}
                    onChange={(e) => setAddress(e.target.value)}
                    style={{ padding: "10px", width: "300px", fontSize: "16px" }}
                />
            </div>

            <text>Tarjeta de Debito/Credito</text>
            <div style={{ marginBottom: "20px" }}>
                <input
                    type="text"
                    placeholder="16 digitos"
                    value={targetDeb}
                    onChange={(e) => setTargerDeb(e.target.value)}
                    style={{ padding: "10px", width: "300px", fontSize: "16px" }}
                />
            </div>

            <text>Contrase√±a</text>
            <div style={{ marginBottom: "20px" }}>
                <input
                    type="text"
                    placeholder="16 digitos"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    style={{ padding: "10px", width: "300px", fontSize: "16px" }}
                />
            </div>

            <text>Clave para descifrar</text>
            <div style={{ marginBottom: "20px" }}>
                <Button
                    variant="contained"
                    color="primary"
                    style={{ marginRight: "10px" }}
                >
                    Cifrar Datos
                </Button>
                <Button
                    variant="contained"
                    color="secondary"
                >
                    Descifrar Datos
                </Button>
            </div>
            <div>
                {outputMessage && (
                    <textarea
                        readOnly
                        value={outputMessage}
                        style={{
                            width: "300px",
                            height: "200px",
                            padding: "10px",
                            fontSize: "16px",
                            resize: "none",
                            border: "1px solid #ccc",
                            borderRadius: "4px",
                            marginBottom: "10px",
                        }}
                    />
                )}
            </div>
        </div>
    );
};

export { CifradoDjango };
